upper = 50;
idx = 0;
while idx < 6
    for e = t
        if max(e{1}(:,2)) <= upper && max(e{1}(:,2)) >= 50
            idx = idx + 1;
        end
    end
    upper = upper + 1;
end
upper = upper - 1;
legendTwo = {'50 Deg'};
idx = 0;
for e = t
    idx = idx + 1;
    if max(e{1}(:,2)) <= upper && max(e{1}(:,2)) >= 50
        plot(e{1}(:,1),e{1}(:,2));
        legendTwo{end+1} = caseList{idx};
    end
end
newLegend = legend();
newLegend = newLegend.String;
idx = size(legendTwo);
newLegend(end-idx(2)+1:end) = legendTwo(1:end);
legend(newLegend);